import React from 'react';
import {  Typography, Box, Grid, makeStyles, TableContainer, Table, TableHead, TableRow, TableCell, TableBody,  } from "@material-ui/core";
const useClasses = makeStyles({
    header: {
        background: 'linear-gradient(45deg,#FE6B8B 30% , #FF8E53 90%)',
        color: 'white',
        padding: 5,
        textTransform: 'uppercase'
    }
})
const View = () => {
    const classes = useClasses();
    return (
        <>
            <Box>
                <Typography
                    variant='h4'
                    align='center'
                    className={classes.header}
                > Student Details </Typography>
            </Box>

            <Grid item md={8} >
                <Box>
                    <Box >
                        <Typography variant='h5' align='center' className={classes.header} >Student List </Typography>
                        <TableContainer>
                            <Table>
                                <TableHead>
                                    <TableRow>
                                        <TableCell>NO.</TableCell>
                                        <TableCell >FullName</TableCell>
                                        <TableCell >Email</TableCell>
                                        <TableCell align='center'>Action</TableCell>
                                    </TableRow>
                                </TableHead>
                                <TableBody>
                                    {students.map((item, index) => {
                                        return <TableList key={index} {...item} />
                                    })}

                                </TableBody>
                            </Table>
                        </TableContainer>
                    </Box>
                </Box>
            </Grid>
        </>
    );
};

export default View;
